import React from 'react';

function CardPage({ img, name, info, img2, starttime, price, detail }) {
  return (
    <div className="container">
      <div className="row justify-content-center">
        <div className="col-md-6 col-lg-4">
          <div className="card" style={{ width: '100%' }}>
            <img src={img} className="card-img-top" alt="..." />
            <div className="card-body">
              <h3 className="card-title">{name}</h3>
              <p className="card-text">{info}</p>
              <div className="d-flex flex-row">
                <img src={img2} className="h-25" alt="..." />
                <p className="card-text">{starttime}</p>
              </div>
              <p className="fs-2">Only at {price}</p>
            </div>
            <b>{detail}</b>
            <hr />
            <button className="btn bg-dark text-white">Know More</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CardPage;
